import style from "./Nav.module.css"
import SearchBar from "../SearchBar/SearchBar";


function Nav(props){
    return(
        <header>
            <div className={style.Title}>
                <img alt="logo" src={"https://vignette.wikia.nocookie.net/logopedia/images/b/b1/Rick_and_Morty.svg/revision/latest/scale-to-width-down/640?cb=20180522080112"}/>
            </div>
            <SearchBar onSearch = {props.onSearch}/>
            <div className={style.ButtonsContainer}>
                <button>about</button>
                <button></button>
            </div>
        </header>
    )
}

export default Nav;
